import React from "react";

const DynamicTable = ({sqlData}) => {

    let columns = []

    

    for(let i in schemaAsObject.properties){
        columns.push(i)
    }

    console.log(columns)
    return (
        <table>
            <thead>
                <tr>
                    {columns.map((item, index) => <ColumnName item = {item}/>)}
                </tr>
            </thead>
            <tbody>
                <tr>

                </tr>
            </tbody>
        </table>
    )

}

const ColumnName = ({item}) => <th>{item}</th>

const schema = `{
    "type": "object",
    "tablename": "People",
    "properties": {
      "name": {
        "type": "string"
      },
      "age": {
        "type": "integer",
        "enum": [1,2,3]
      },
      "married": {
        "type": "boolean",
        "default": false
      }
    },
    "required": [
      "name",
      "age",
      "married"
    ]
  }`;
  
  const schemaAsObject = JSON.parse(schema);

export default DynamicTable;
